<template>
  <div class="login-wrap">
    <el-form label-position="left" :model="ruleForm" :rules="rules" ref="ruleForm" label-width="0px" class="demo-ruleForm login-container">
      <h3 class="title">用户注册</h3>
      <el-form-item prop="username">
        <el-input type="text" v-model="ruleForm.username" auto-complete="off" placeholder="账号"></el-input>
      </el-form-item>
      <el-form-item prop="password">
        <el-input type="password" v-model="ruleForm.password" auto-complete="off" placeholder="密码"></el-input>
      </el-form-item>
      <el-form-item style="width:100%;">
        <el-button class="register" style="width:100%;" @click="doRegister(ruleForm)">注册</el-button>
      </el-form-item>
    </el-form>
  </div>
</template>

<script>
import { register } from "../../apis/user";

export default {
  name: "register",
  data() {
    return {
      ruleForm: {
        //username和password默认为空
        username: '',
        password: '',
      },
      //rules前端验证
      rules: {
        username: [{ required: true, message: '请输入账号', trigger: 'blur' }],
        password: [{ required: true, message: '请输入密码', trigger: 'blur' }],
      }
    }
  },
  methods: {
    async doRegister(value) {
      const gotoMainPage = () => {
        const redirect =
          (this.$route.query && this.$route.query.redirect) || "/";
        this.$router.push({ path: redirect });
      };

      try {
        localStorage.setItem("token", "tokeninit");
        const result = await register(value);
        console.log(result);
        if (result.code === 200) {
          this.$message.success("注册成功");
          setTimeout( () => {
            this.$router.push({path: '/login'});
          }, 2000);  
        } else if (result.code === 454) {
          this.$message.error("用户已存在");
        }
      } catch (err) {
        this.$message.error("注册失败");
        console.log("error", err);
      }
    },
  },
};
</script>

